# Tarefa

**Descrição**: Fazer planejamento das Sprints até a `Release 2`.

### Critérios de Conclusão

- [x] Identificar Requisitos que ainda não foram concluídos;
- [x] Identificar requisitos que foram evidenciados apenas após a conclusão da primeira Release, se existirem;
- [x] Criar um documento contendo todos os requisitos reunidos e suas respectivas prioridades, bem como o planejamento de `Sprints` para que esses requisitos sejam atendidos até a `Release 2`.
